TG: https://t.me/amino_20_erc

**/

pragma solidity ^0.8.20;




interface IUniswapV2Router {
    function factory() external pure returns (address);
    function WETH() external pure returns (address);

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external;

    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external payable returns (uint amountToken, uint amountETH, uint liquidity);
}

interface IUniswapV2Factory {
    function createPair(address tokenA, address tokenB) external returns (address pair);
}

contract TokenWithCommission is ERC20, Ownable {

    IUniswapV2Router public immutable uniswapV2Router;
    address public immutable uniswapV2Pair;

    address public treasuryWallet;
    address public refSystemWallet;

    uint256 public constant buyFee = 10; // 1.5%
    uint256 public constant sellFee = 35; // 3.5% (3% to treasury, 0.5% to ref system)

    uint256 private tokenDeployTimestamp;

    uint256 public accumulatedFees;

    // exlcude from fees and max transaction amount
    mapping(address => bool) private _isExcludedFromFees;

    constructor(
        string memory _name,
        string memory _symbol,
        address _uniswapV2RouterAddress,
        uint256 _totalSupply,
        address _treasuryWallet,
        address _refSystemWallet
    ) ERC20(_name, _symbol) Ownable(_treasuryWallet) {

        IUniswapV2Router _uniswapV2Router = IUniswapV2Router(_uniswapV2RouterAddress);
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), _uniswapV2Router.WETH());

        tokenDeployTimestamp = block.timestamp;

        treasuryWallet = _treasuryWallet;
        refSystemWallet = _refSystemWallet;

        // Our parent contract will be adding liquidity
        _isExcludedFromFees[msg.sender] = true;
        _isExcludedFromFees[address(this)] = true;

        _mint(msg.sender, _totalSupply);
    }

    receive() external payable {}

    function excludeFromFees(address account, bool excluded) external onlyOwner {
        _isExcludedFromFees[account] = excluded;
    }

    function updateTreasuryWallet(address _treasuryWallet) external onlyOwner {
        treasuryWallet = _treasuryWallet;
    }

    function updateRefSystemWallet(address _refSystemWallet) external onlyOwner {
        refSystemWallet = _refSystemWallet;
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function withdrawETH() external onlyOwner returns (bool) {
        (bool success, ) = owner().call{value: address(this).balance}("");
        return success;
    }

    function _update(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        if (amount == 0 || from == address(0) || to == address(0)) {
            return super._update(from, to, amount);
        }

        // only take fees on buys/sells, do not take on wallet transfers
        bool isBuy = address(uniswapV2Pair) == from;
        bool isSell = address(uniswapV2Pair) == to;
        if ((isBuy || isSell) && !(_isExcludedFromFees[from] || _isExcludedFromFees[to])) {
            uint256 fees = 0;
            // on sell
            if (isSell && sellFee > 0) {
                fees = amount * getActualSellFee() / 1000;
            }
            // on buy
            else if (isBuy && buyFee > 0) {
                fees = amount * getActualBuyFee() / 1000;
            }

            if (fees > 0) {
                super._update(from, address(this), fees);
                if (isBuy) {
                    accumulatedFees += fees;
                } else {
                    swapTokensForEth(fees, false);
                    if (accumulatedFees > 0) {
                        swapTokensForEth(accumulatedFees, true);
                        accumulatedFees = 0;
                    }
                }
            }

            amount -= fees;
        }

        super._update(from, to, amount);
    }

    function swapTokensForEth(uint256 tokenAmount, bool isBuy) public {

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );

        if (isBuy) {
            payable(refSystemWallet).transfer(address(this).balance / 7);
            payable(treasuryWallet).transfer(address(this).balance);
        } else {
            payable(treasuryWallet).transfer(address(this).balance);
        }

    }

    function getActualBuyFee() public view returns (uint256) {
        uint256 minutsAfterDeploy = (block.timestamp - tokenDeployTimestamp) / 1 minutes;
        if (minutsAfterDeploy == 0) {
            return buyFee * 1;
        } else if (minutsAfterDeploy == 1) {
            return buyFee * 1;
        } else if (minutsAfterDeploy == 2) {
            return buyFee * 1;
        } else {
            return buyFee;
        }
    }

    function getActualSellFee() public view returns (uint256) {
        uint256 minutsAfterDeploy = (block.timestamp - tokenDeployTimestamp) / 1 minutes;
        if (minutsAfterDeploy == 0) {
            return sellFee * 1;
        } else if (minutsAfterDeploy == 1) {
            return sellFee * 1;
        } else if (minutsAfterDeploy == 2) {
            return sellFee * 1;
        } else {
            return sellFee;
        }
    }

    function swapAccumulatedFeesManually() external {
        swapTokensForEth(accumulatedFees, true);
        accumulatedFees = 0;
    }

}
